import TextField from '@mui/material/TextField';
import Box from '@mui/material/Box';
import Button from '@mui/material/Button';
import BasicSelect from '../../components/IdeaComponents/Select';
import { makeStyles } from "@material-ui/core";

const useStyles = makeStyles(() => ({
    Form: {
        flex: 1,
        backgroundColor: bgColor.paper,
        color: "white",
    },
}));

const AddIdea = () => {
    const classes = useStyles();

    return (
        <Box component = 'form' className={classes.Form}>
            <div>
                <TextField id="ideaName" label="Name of Idea" variant="standard" />
            </div>
            <div>
                <TextField id="ideaDescription" label="Description" variant="standard" />
            </div>
            <div>
                <BasicSelect />
            </div>
            <div>
                <Button style={{float: 'right'}} variant="contained">Submit</Button>
            </div>
        </Box>
    )
}

export default AddIdea
